import React from 'react';
import './App.css';
import Header from './Components/Header';
import "bootstrap/dist/css/bootstrap.min.css";
import logo from "../";
function App() {
  return (
    <div>
      <Header />
      <img src={logo} />
    </div>
  );
}

export default App;
